cy.request('https://simple-books-api.glitch.me/status').as('request');
cy.get('@request').then(response => {
  expect(response.status).to.be.equal(200);
});

cy.request({
  method: 'POST',
  url: 'https://simple-books-api.glitch.me/api-clients/',
  failOnStatusCode: false,
  body: {
    clientName: "ondra",
    clientEmail: "me@mail.com"
  }
}).as('authRequest');
cy.get('@authRequest').then(response => {
  expect(response.status).to.be.equal(409);
  cy.wrap(response.body).should('deep.include', {
    error: 'API client already registered. Try a different email.'
  });
});

cy.request('https://simple-books-api.glitch.me/books').as('booksRequest');
cy.get('@booksRequest').then(response => {
  expect(response.status).to.be.equal(200);
  assert.isArray(response.body);
  expect(response.body).have.length(6);
});

cy.request({
  method: 'GET',
  url: 'https://simple-books-api.glitch.me/books',
  qs: {
    type: 'non-fiction'
  }
}).as('nonFiction');
cy.get('@nonFiction').then(response => {
  expect(response.status).to.be.equal(200);
  assert.isArray(response.body);
  expect(response.body).have.length(2);
  cy.wrap(response.body[0]).should('deep.include', {
    id: 2,
    name: "Just as I Am",
    type: "non-fiction",
    available: false
  });
  cy.wrap(response.body[1]).should('contain', {
    available: true
  });
});

cy.request({
  method: 'GET',
  url: `https://simple-books-api.glitch.me/books/${bookId}`
}).as('singleBook');
cy.get('@singleBook').then(response => {
  expect(response.status).to.be.equal(200);
  cy.wrap(response.body).should('deep.include', {
    "id": 5,
    "name": "Untamed",
    "author": "Glennon Doyle",
    "type": "non-fiction",
    "price": 15.5,
    "current-stock": 20,
    "available": true
  });
});

cy.request({
  method: 'POST',
  url: `https://simple-books-api.glitch.me/orders`,
  auth: {
    bearer: authToken
  },
  body: {
    bookId: bookId,
    clientName: "Valentin"
  }
}).as('order');
cy.get('@order').then(response => {
  expect(response.status).to.be.equal(201);
  expect(response.body.created).to.be.true;
  expect(response.body).to.include.key('orderId');
  orderId = response.body.orderId;
});

cy.request({
  method: 'GET',
  url: `https://simple-books-api.glitch.me/orders`,
  auth: {
    bearer: authToken
  }
}).as('order');
cy.get('@order').then(response => {
  expect(response.status).to.be.equal(200);
  expect(response.body).to.have.length(1);
  expect(response.body[0]).to.include.key('id', 'quantity');
  expect(response.body[0].id).to.equal(orderId);
  expect(response.body[0].quantity).to.equal(1);
});

cy.request({
  method: 'PATCH',
  url: `https://simple-books-api.glitch.me/orders/${orderId}`,
  auth: {
    bearer: authToken
  },
  body: {
    customerName: 'Val'
  }
}).as('order');
cy.get('@order').then(response => {
  expect(response.status).to.be.equal(204);
});
cy.request({
  method: 'GET',
  url: `https://simple-books-api.glitch.me/orders`,
  auth: {
    bearer: authToken
  }
}).as('order');
cy.get('@order').then(response => {
  expect(response.status).to.be.equal(200);
  expect(response.body[0]).to.include.key('customerName');
  expect(response.body[0].customerName).to.eql('Val');
});

cy.request({
  method: 'DELETE',
  url: `https://simple-books-api.glitch.me/orders/${orderId}`,
  auth: {
    bearer: authToken
  }
}).as('delOrder');
cy.get('@delOrder').then(response => {
  expect(response.status).to.be.equal(204);
});
cy.request({
  method: 'GET',
  url: `https://simple-books-api.glitch.me/orders`,
  auth: {
    bearer: authToken
  }
}).as('order');
cy.get('@order').then(response => {
  expect(response.status).to.be.equal(200);
  expect(response.body).to.have.length(0);
});

cy.request('https://jsonplaceholder.typicode.com/todos').as('todoRequest').its('body').should('have.length', 200);
cy.get('@todoRequest').then(response => {
  expect(response.status).to.be.equal(200);
  assert.isArray(response.body, 'Todos response is an array');
});

cy.request('GET', 'https://jsonplaceholder.typicode.com/todos', {
  title: "eightdelectus aut autem",
  userId: 1
}).as('todoRequest');
cy.get('@todoRequest').then(response => {
  expect(response.status).to.eq(200);
});

cy.request('POST', 'https://jsonplaceholder.typicode.com/todos', {
  userId: "11",
  title: 'My title',
  completed: true
}).as('todoRequest'); // adds new Todo item by defining Todo name
cy.get('@todoRequest').then(response => {
  expect(response.status).to.eq(201);
  cy.wrap(response.body).should('deep.include', {
    userId: '11',
    id: 201,
    title: 'My title',
    completed: true
  });
});

